// Libraries
import React from 'react'

// Components
import Button from 'shared/button'

const buildButtons = buttons => {
  const buildButtons = buttons.map(({ text, icon, style, onClick }, index) => {
    return (
      <Button buttonStyle={style} onClick={onClick} icon={icon} key={index}>
        {text}
      </Button>
    )
  })
  return <div>{buildButtons}</div>
}
const InternalHeader = ({ title, buttons }) => {
  return (
    <header className='internal-header'>
      <h1 className='headline is-marginless'>{title}</h1>
      {buildButtons(buttons)}
    </header>
  )
}

export default InternalHeader
